public class InnerReplicatorTopicReplicationFactory(Action<Humidifier.MSK.ReplicatorTypes.TopicReplication> factoryAction = null) : SubResourceFactory<Humidifier.MSK.ReplicatorTypes.TopicReplication>
{

    internal InnerReplicatorReplicationStartingPositionFactory StartingPositionFactory { get; set; }

    internal InnerReplicatorReplicationTopicNameConfigurationFactory TopicNameConfigurationFactory { get; set; }

    protected override Humidifier.MSK.ReplicatorTypes.TopicReplication Create()
    {
        var topicReplicationResult = CreateTopicReplication();
        factoryAction?.Invoke(topicReplicationResult);

        return topicReplicationResult;
    }

    private Humidifier.MSK.ReplicatorTypes.TopicReplication CreateTopicReplication()
    {
        var topicReplicationResult = new Humidifier.MSK.ReplicatorTypes.TopicReplication();

        return topicReplicationResult;
    }
    public override void CreateChildren(Humidifier.MSK.ReplicatorTypes.TopicReplication result)
    {
        base.CreateChildren(result);

        result.StartingPosition ??= StartingPositionFactory?.Build();
        result.TopicNameConfiguration ??= TopicNameConfigurationFactory?.Build();
    }

} // End Of Class

